import React, { Component } from 'react'

class EventBind extends Component {

    constructor(props) {
        super(props)
    
        this.state = {
            message:'hello'
        }
    }
    
    render() {
        return (
            <div>
                <div>this.state.message</div>
               <button>CLICK</button> 
            </div>
        )
    }
}

export default EventBind
